      height_l=\"683\" width_l=\"1024\" pathalias=\"zeeyolqpictures\">\n\t\t<description>Eiffel
      tower (la tour Eiffel in French) - Quartier du gros-caillou.\nYou can see the
      Invalids on the left, the Ecole militaire and the Montparnasse tower behind
      the Eiffel tower. The bridge of the Seine river in front of you is the Iena
      bridge.\n\nThe Eiffel Tower (French: La tour Eiffel, [tu\u0281 \u025Bf\u025Bl])
      is an iron lattice tower located on the Champ de Mars in Paris. It was named
      after the engineer Gustave Eiffel, whose company designed and built the tower.
      Erected in 1889 as the entrance arch to the 1889 World&#039;s Fair, it was initially
      criticised by some of France&#039;s leading artists and intellectuals for its
      design, but has become both a global cultural icon of France and one of the
      most recognizable structures in the world. The tower is the tallest structure
      in Paris and the most-visited paid monument in the world; 6.98 million people
      ascended it in 2011. The tower received its 250 millionth visitor in 2010.\n\nThe
      tower is 324 metres (1,063 ft) tall, about the same height as an 81-storey building.
      During its construction, the Eiffel Tower surpassed the Washington Monument
      to assume the title of the tallest man-made structure in the world, a title
      it held for 41 years, until the Chrysler Building in New York City was built
      in 1930. Because of the addition of the aerial atop the Eiffel Tower in 1957,
      it is now taller than the Chrysler Building by 5.2 metres (17 ft). Not including
      broadcast aerials, it is the second-tallest structure in France, after the Millau
      Viaduct.\n\nThe tower has three levels for visitors, with restaurants on the
      first and second. The third level observatory&#039;s upper platform is 276 m
      (906 ft) above the ground, the highest accessible to the public in the European
      Union. Tickets can be purchased to ascend by stairs or lift (elevator) to the
      first and second levels. The climb from ground level to the first level is over
      300 steps, as is the walk from the first to the second level. Although there
      are stairs to the third and highest level, these are usually closed to the public
      and it is generally only accessible by lift.\n&lt;a href=&quot;http://en.wikipedia.org/wiki/Eiffel_Tower&quot;
      rel=&quot;nofollow&quot;&gt;en.wikipedia.org/wiki/Eiffel_Tower&lt;/a&gt;\n\n---------------------------------------\n\nLa
      tour Eiffel est une tour de fer puddl\xE9 de 324 m\xE8tres de hauteur (avec
      antennes) situ\xE9e \xE0 Paris, \xE0 l\u2019extr\xE9mit\xE9 nord-ouest du parc
      du Champ-de-Mars en bordure de la Seine dans le 7e arrondissement. Construite
      par Gustave Eiffel et ses collaborateurs pour l\u2019Exposition universelle
      de Paris de 1889, et initialement nomm\xE9e \xAB tour de 300 m\xE8tres \xBB,
      ce monument est devenu le symbole de la capitale fran\xE7aise, et un site touristique
      de premier plan : il s\u2019agit du second site culturel fran\xE7ais payant
      le plus visit\xE9 en 2011, avec 7,1 millions de visiteurs dont 75 % d&#039;\xE9trangers
      en 2011, la cath\xE9drale Notre-Dame de Paris \xE9tant en t\xEAte des monuments
      \xE0 l&#039;acc\xE8s libre avec 13,6 millions de visiteurs estim\xE9s mais il
      reste le monument payant le plus visit\xE9 au monde. Elle a accueilli son 250
      millioni\xE8me visiteur en 2010.\nD\u2019une hauteur de 312 m\xE8tres \xE0 l\u2019origine,
      la tour Eiffel est rest\xE9e le monument le plus \xE9lev\xE9 du monde pendant
      41 ans. Le second niveau du troisi\xE8me \xE9tage, appel\xE9 parfois quatri\xE8me
      \xE9tage, situ\xE9 \xE0 279,11 m, est la plus haute plateforme d&#039;observation
      accessible au public de l&#039;Union europ\xE9enne et la deuxi\xE8me plus haute
      d&#039;Europe, derri\xE8re la Tour Ostankino \xE0 Moscou culminant \xE0 337
      m. La hauteur de la tour a \xE9t\xE9 plusieurs fois augment\xE9e par l\u2019installation
      de nombreuses antennes. Utilis\xE9e dans le pass\xE9 pour de nombreuses exp\xE9riences
      scientifiques, elle sert aujourd\u2019hui d\u2019\xE9metteur de programmes radiophoniques
      et t\xE9l\xE9vis\xE9s.\n&lt;a href=&quot;http://fr.wikipedia.org/wiki/Tour_Eiffel&quot;
      rel=&quot;nofollow&quot;&gt;fr.wikipedia.org/wiki/Tour_Eiffel&lt;/a&gt;\n&lt;a
      href=&quot;http://fr.wikipedia.org/wiki/Paris&quot; rel=&quot;nofollow&quot;&gt;fr.wikipedia.org/wiki/Paris&lt;/a&gt;\n</description>\n\t</photo>\n</photoset>\n</rsp>\n"
